import React, { Component } from 'react';

class DisclosuresBottom extends Component {
  render() {
    return (
      <div className="certification" id="main-certifications-disclosures">
        <p>
          For analyst certification(s) and important disclosures, please{' '}
          <a href="#0-link-to-disclosures">click here.</a>
        </p>
      </div>
    );
  }
}

export default DisclosuresBottom;
